'''
Ran using Python 3.6.8

-------Generates labels for thw word_map in record_serial.py--------
total words = 4757 + 'FINISHED FINISHED FINISHED FINISHED FINISHED'
total train_labels = 3800
total test_labels = 4757 - 3800 = 957

20 seesions of training and testing each

IMPORTANT NOTE:
Utkarsh used testing chunks
Arnav used Shuffled testing chunks
'''

import random

def chunkIt(seq, num):
	avg = len(seq) / float(num)
	out = []
	last = 0.0

	while last < len(seq):
		out.append(seq[int(last):int(last + avg)])
		last += avg

	return out

train_labels = random.sample(range(4757), 3800)
total = list(range(4757))
test_labels = []

for item in total:
	if item not in train_labels:
		test_labels.append(item)

random.shuffle(test_labels)

# print(train_labels)
# print(test_labels)

train_chunks = chunkIt(train_labels, 20) # 20 sessions
test_chunks = chunkIt(test_labels, 20) # 20 sessions

# print(train_chunks)
# print(test_chunks)

print('TRAINING CHUNKS')
for item in train_chunks:
	print(item)

print('TESTING CHUNKS')
for item in test_chunks:
	print(item)

